webpackJsonp([0xd014f6d5aeb4],{3095:function(e,n){e.exports={pathContext:{docHtml:'<h1>Change Log</h1>\n<p>All notable changes will be documented in this file.</p>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/v3.2.0...v3.3.0">3.3.0</a> - 2017-04-24</h2>\n<h3>Changes</h3>\n<ul>\n<li>Support legacy auth token config key (Zoltan Kochan)</li>\n<li>Use safe-buffer module for backwards-compatible base64 encoding/decoding (Espen Hovlandsdal)</li>\n<li>Change to standard.js coding style (Espen Hovlandsdal)</li>\n</ul>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/v3.1.2...v3.2.0">3.2.0</a> - 2017-04-20</h2>\n<h3>Changes</h3>\n<ul>\n<li>Allow passing parsed npmrc from outside (Zoltan Kochan)</li>\n</ul>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/v3.1.1...v3.1.2">3.1.2</a> - 2017-04-07</h2>\n<h3>Changes</h3>\n<ul>\n<li>Avoid infinite loop on invalid URL (Zoltan Kochan)</li>\n</ul>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/v3.1.0...v3.1.1">3.1.1</a> - 2017-04-06</h2>\n<h3>Changes</h3>\n<ul>\n<li>Nerf-dart URLs even if recursive is set to false (Espen Hovlandsdal)</li>\n</ul>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/v3.0.1...v3.1.0">3.1.0</a> - 2016-10-19</h2>\n<h3>Changes</h3>\n<ul>\n<li>Return the password and username for Basic authorization (Zoltan Kochan)</li>\n</ul>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/v3.0.0...v3.0.1">3.0.1</a> - 2016-08-07</h2>\n<h3>Changes</h3>\n<ul>\n<li>Fix recursion bug (Lukas Eipert)</li>\n<li>Implement alternative base64 encoding/decoding implementation for Node 6 (Lukas Eipert)</li>\n</ul>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/v2.1.1...v3.0.0">3.0.0</a> - 2016-08-04</h2>\n<h3>Added</h3>\n<ul>\n<li>Support for Basic Authentication (username/password) (Lukas Eipert)</li>\n</ul>\n<h3>Changes</h3>\n<ul>\n<li>The result format of the output changed from a simple string to an object which contains the token type</li>\n</ul>\n<pre><code class="language-js">  // before: returns \'tokenString\'\n  // after: returns {token: \'tokenString\', type: \'Bearer\'}\n  getAuthToken()\n</code></pre>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/v2.1.0...v2.1.1">2.1.1</a> - 2016-07-10</h2>\n<h3>Changes</h3>\n<ul>\n<li>Fix infinite loop when recursively resolving registry URLs on Windows (Espen Hovlandsdal)</li>\n</ul>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/v2.0.0...v2.1.0">2.1.0</a> - 2016-07-07</h2>\n<h3>Added</h3>\n<ul>\n<li>Add feature to find configured registry URL for a scope (Espen Hovlandsdal)</li>\n</ul>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/v1.1.1...v2.0.0">2.0.0</a> - 2016-06-17</h2>\n<h3>Changes</h3>\n<ul>\n<li>Fix tokens defined by reference to environment variables (Dan MacTough)</li>\n</ul>\n<h2><a href="https://github.com/rexxars/registry-auth-token/compare/a5b4fe2f5ff982110eb8a813ba1b3b3c5d851af1...v1.1.1">1.1.1</a> - 2016-04-26</h2>\n<h3>Changes</h3>\n<ul>\n<li>Fix for registries with port number in URL (Ryan Day)</li>\n</ul>',docPath:"argo-ci/node_modules/registry-auth-token/changelog",proj:"argo-ci"}}}});
